import React from 'react';

function LoginSignup(props) {
    return (
        <form>
        <div className='mb-3'>
            <label htmlFor='name' className='form-label'>Name</label>
            <input id='name' type='text' className='form-control'></input>
        </div>
        </form>
    );
}

export default LoginSignup;
